import { Tab ,AppBar ,Tabs ,Typography ,Box ,Grid , Button} from '@material-ui/core';
import { useState} from "react"
import "./MenuComponent.css"


function TabPanel(props) {
    const { children, value, index } = props;

    return (
      <div role="tabpanel">
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }



export default function MenuComponent(){
    const [ value, setValue ] = useState(0);
    const handleChange = (event, newValue) => {
      setValue(newValue);
    };
    return (
      <div>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Grid container spacing={0} direction="row" justify="center" alignItems="baseline" >
                <Grid item xs={10} className="logoLeo" >LEONARDO</Grid>
                <Grid item xs={2}>
                  <Grid container spacing={0} direction="row" justify="space-evenly" alignItems="baseline">
                    <Button variant="contained">Default</Button>
                    <Button variant="contained" color="primary">Primary</Button>
                  </Grid>
                </Grid>
            </Grid>
          </Grid>
            <Grid item xs={12}>
                  <AppBar position="static" >
                  <Grid container spacing={2} direction="row" justify="center" alignItems="baseline">
                    <Tabs
                    className="app-bar"
                      value={value}
                      onChange={handleChange}
                    >

                        <Tab label="Item One" />
                        <Tab label="Item Two" />
                        <Tab label="Item Three" />

                    </Tabs>
                    </Grid>
                  </AppBar>
                <TabPanel value={value} index={0}>
                  Item One
                </TabPanel>
                <TabPanel value={value} index={1}>
                  Item Two
                </TabPanel>
                <TabPanel value={value} index={2}>
                  Item Three
                </TabPanel>

            </Grid>
        </Grid>
      </div>
    );
}
